.header-subtitle {
  text-transform: uppercase;
  margin-bottom: 5rem;
}

.header-button {
  transform: translateZ(.1px);
  position: relative;
  z-index: 10;
}

.animate-pop-in {
  animation: pop-in .6s ease-out forwards;
  opacity: 0;
}

.rocky-dashed {
  animation-delay: 1s;
}

.header-title {
  animation-delay: 1.2s;
}

.header-subtitle {
  animation-delay: 1.4s;
}

.header-button {
  animation-delay: 1.6s;
}


/* Animations */

@keyframes pop-in {
  0% {
    opacity: 0;
    transform: translateY(-4rem) scale(.8);
  }
  100% {
    opacity: 1;
    transform: none;
  }
}

.work-card {
                 transition: transform 1s;
            }
            .work-card p{
                 transition: transform 1s;
            }
            .work-card:hover {
  transform: rotate(10deg);
            }
            .work-card:hover p{
  transform: rotate(-10deg);
            }
